import zlib
import base64
import os

def compress_file_to_base64(file_path):
    with open(file_path, 'rb') as f:
        file_data = f.read()
    compressed_data = zlib.compress(file_data)
    base64_encoded = base64.b64encode(compressed_data)
    return base64_encoded.decode('utf-8')


def decompress_base64_to_file(base64_str, output_file_path):
    # Декодируем строку из base64 в байты
    compressed_data = base64.b64decode(base64_str)
    # Распаковываем сжатые данные
    decompressed_data = zlib.decompress(compressed_data)
    # Записываем результат в файл в бинарном режиме
    with open(output_file_path, 'wb') as f:
        f.write(decompressed_data)


def save_files_as_string_array():
    files = ['static/404_not_found.jpg', 'static/favicon.svg', 'templates/404_page.html', 'templates/index.html']
    result = []

    for file in files:
        result.append(file+';'+compress_file_to_base64(file))

    with open('out.txt', "w", encoding="utf-8") as f:
        f.write(str(result))
    # print(result)


